import Layout from '../components/Layout';
import MyGrid from '../components/MyGrid';
import CustomerForm from '../components/CustomerForm';



export default function About() {
  return (
    <Layout>
      <MyGrid 
        columnNum = {1} 
        header='Board and Train Program Form'
        message=''
      >
        <CustomerForm/>
      </MyGrid>
    </Layout>
  );
}
